    true,nt"url": null,nt"notes": "This data set shows the location of Baltimore
    City's Public Aquatic "Pools" Facilities. The data is broken down into categories:
    Wading, Walk-to, and Park Pools. Please find the definitions below: Wading Pools:
    are aquatic facilites that are no more than 24 inches in dept. These facilities
    are not chlorinated and has a turn over rate of approximately two hours. Walk-to
    Pools: are Aquatic facilities that are located within a neighborhood and not in
    a public park. These facilities are approximately 5ft in dept. Park Pools: are aquatic
    facilities that are located within the City's public parks. These facilities are
    more than 5ft in depth.",nt"license_title": "Other License Specified",nt"extras":
